import React from 'react';
import { Link } from 'react-router-dom';

const links = [
    {
        href: '/',
        label: 'Home',
    },
    {
        href: '/companies',
        label: 'Companies',
    },
    {
        href: '/jobs',
        label: 'Jobs',
    },
    {
        href: '/candidates',
        label: 'Candidates',
    },
];

const Navbar = () => {
    return (
        <div className='navbar'>
            <div className='brand'>
                <span>Resume Management</span>
                <div className='menu'>
                  <ul>
                    {links.map(item => (
                      <li></li>
                    ))}
                  </ul>
                </div>
                <div className='hamburger'></div>
                <div className='toggle'></div>
            </div>
        </div>
    );
};

export default Navbar;
